# encoding: utf-8
class Solution:
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """
        s_list1 = list(s)
        s_list2 = []
        s_len = len(s_list1)
        flag = False
        if s_len == 1:
            return 0
        else:
            for i in range(s_len):
                for j in range(i + 1, s_len):
                    if s_list2.count(s_list1[i]) == 0:
                        if s_list1[i] == s_list1[j]:
                            s_list2.append(s_list1[i])
                            flag = False
                            break
                        else:
                            flag = True
                    else:
                        flag = False
                        break
                if flag or (i == s_len - 1 and s_list2.count(s_list1[i]) == 0):
                    return i
        return -1


r = Solution()
print(r.firstUniqChar('leetcode'))
print(r.firstUniqChar('loveleetcode'))
print(r.firstUniqChar('dacca'))
print(r.firstUniqChar(''))
print(r.firstUniqChar(
    ''))
